text:
Dios le bendiga hermano. Siga adelante, avanzando en el camino que es Jesucristo; 
obedeciendo su palabra, y el propósito por el cuál ha sido llamado a salvación.
Bendiciones.

Numeros 6:24 Jehová te bendiga, y te guarde;

25 Jehová haga resplandecer su rostro sobre ti, y tenga de ti misericordia;

26 Jehová alce sobre ti su rostro, y ponga en ti paz.
